Two Navy SEALs and our incredible Commander-in-Chief. Thank you, @POTUS for loving our country and working tirelessly to Make America Great Again for all Americans. 

@RepVanOrden and I appreciate you hosting us at the first Rose Garden Club dinner at the White House. 
It was a honor to be there. 
🇺🇸🇺🇸🇺🇸

@NRCC @HouseGOP

Medicaid was originally created as a safety net for pregnant woman, low-income seniors, & Americans w/ disabilities. Today, it has ballooned well beyond its original purpose.  In VA, a woman committed $1.3 million in health care fraud through Medicaid. 

The One Big Beautiful Bill is a critical step to rooting out waste, fraud, & abuse from the system. It ensures that we are tightening the eligibility requirements to ensure only those intended receive Medicaid benefits. 

@HouseGOP & @SpeakerJohnson delivered for the American people.

Honored to attend tonight's reception at the @WhiteHouse with my wife, Tracy, to celebrate passage of the One Big Beautiful Bill.

@HouseGOP is standing with @POTUS to deliver for the American people!

🇺🇸🇺🇸🇺🇸 https://t.co/zvKTrfylVl

One year ago today, President Trump survived an assassination attempt in Butler, PA. 

He has never stopped fighting for all Americans. He is America’s Fighter. 

@realDonaldTrump, thank you for your resilience &amp; sacrifice for our Nation. 🇺🇸

Our warfighters can’t afford to wait years for technologies to defend America.

The FY26NDAA focuses taxpayer dollars on delivering capability, not feeding bureaucratic processes.

@HASCRepublicans are focusing on cutting red tape & getting our servicemembers what they need to win now.

It was an honor to temporarily chair the House Armed Services Committee for Chairman
@RepMikeRogersAL.

@HASCRepublicans are committed to protecting the American people with peace through strength, fully supporting our warfighters, and prioritizing President Trump’s America First agenda.

@HouseGOP led the charge to protect Americans from the ongoing fentanyl crisis today.

Thanks to everyone who voted to support @Repmgriffith's HALT Fentanyl Act.

